import React, { useEffect, useState, useRef } from 'react';
import axios from 'axios';
import { BrowserRouter as Router, Route, Switch, useHistory } from 'react-router-dom';
import Dropdown from './components/dropdown';
import ProfilePage from './StudentProfile'; // Import the profile page component
import './App.css';
import image from './Assets/logo.png';

function App() {
  const [openDropdown, setOpenDropdown] = useState(null);
  const [selectedYear, setSelectedYear] = useState('');
  const [selectedDepartment, setSelectedDepartment] = useState('');
  const [selectedSection, setSelectedSection] = useState('');
  const [selectedGender, setSelectedGender] = useState('');
  const [selectedCountry, setSelectedCountry] = useState('');
  const [selectedScores, setSelectedScores] = useState([]);
  const [data, setData] = useState([]);
  const [filteredData, setFilteredData] = useState([]);
  const [dropdownData, setDropdownData] = useState({
    years: [],
    departments: [],
    sections: [],
    genders: [],
    countries: [],
    scores: [],
  });

  const [sortConfigs, setSortConfigs] = useState([]);
  const dropdownRef = useRef(null);
  const history = useHistory(); // Use history for navigation

  // (Other code remains unchanged)

  const handleRowClick = (student) => {
    // Navigate to the profile page with the selected student's data
    history.push({
      pathname: `/profile`,
      state: { student },
    });
  };

  return (
    <Router>
      <Switch>
        <Route exact path="/">
          <>
            <div className='header'>
              <img src={image} alt='logo' />
            </div>
            <div className='title'>
              <h2>Higher Studies Students Data</h2>
            </div>
            <div className='filter' ref={dropdownRef}>
              {/* (Dropdown code remains unchanged) */}
            </div>
            <div className='table-container'>
              <div className='table-header'>
                <span>S.No</span>
                <span>Student Name</span>
                <span>Student Id</span>
                <span>Department</span>
                <span>Section</span>
                <span>Preferred Degree</span>
                <span>Preferred Course</span>
                <span>Preferred Country</span>
                {selectedScores.map(score => (
                  <span key={score} onClick={() => requestSort(score)} className="sortable-header">
                    {score} {sortConfigs.some(config => config.key === score) ? (sortConfigs.find(config => config.key === score).direction === 'ascending' ? '▲' : '▼') : ''}
                  </span>
                ))}
              </div>
              <div className='scrollable-list'>
                {filteredData.map((item, index) => (
                  <div className='list-item' key={item._id} onClick={() => handleRowClick(item)}>
                    <span>{index + 1}</span>
                    <span>{item.studentname}</span>
                    <span>{item.studentid}</span>
                    <span>{item.department}</span>
                    <span>{item.section}</span>
                    <span>{item.preferreddegree}</span>
                    <span>{item.preferredcourse}</span>
                    <span>{item.preferredcountry}</span>
                    {selectedScores.map(score => (
                      <span key={score}>{item.scores?.[score] || 'N/A'}</span>
                    ))}
                  </div>
                ))}
              </div>
            </div>
          </>
        </Route>
        <Route path="/profile" component={ProfilePage} />
      </Switch>
    </Router>
  );
}

export default App;
